local function checkAOI(area, okarea)
	if #area ~= #okarea then
		return false
	end
	
	local bHave = false
	for _,val in pairs(area) do
		bHave = false
		for _, val2 in pairs(okarea) do
			if val == val2 then
				bHave = true
				break
			end
		end
		if not bHave then
			return false
		end
	end
	
	return true
end
local function TestAOI()
	local aoi = aoi:new(10, 10, 10)
	aoi:Enter(1, 0, 0, 0)
	local inArea = aoi:getArea(1, 1, 1, 1)
	assert(checkAOI(inArea, {1}))
	
	aoi:Enter(2, 0, 1, 0)
	inArea = aoi:getArea(2, 1, 1, 1)
	assert(checkAOI(inArea, {1, 2}))
	
	aoi:Enter(3, 1, 0, 0)
	inArea = aoi:getArea(3, 1, 1, 1)
	assert(checkAOI(inArea, {1, 2, 3}))
	
	aoi:Enter(4, 1, 1, 0)
	inArea = aoi:getArea(4, 1, 1, 1)
	assert(checkAOI(inArea, {1, 2, 3, 4}))
	
	aoi:Enter(5, 1, 2, 0)
	inArea = aoi:getArea(5, 1, 1, 1)
	assert(checkAOI(inArea, {5, 4, 2}))
	
	aoi:Enter(6, 2, 1, 0)
	inArea = aoi:getArea(6, 1, 1, 1)
	assert(checkAOI(inArea, {3, 4, 5, 6}))
	
	aoi:Enter(7, 0, 2, 0)
	inArea = aoi:getArea(7, 1, 1, 1)
	assert(checkAOI(inArea, {2, 4, 5, 7}))
	
	aoi:Enter(8, 2, 0, 0)
	inArea = aoi:getArea(8, 1, 1, 1)
	assert(checkAOI(inArea, {3, 4, 6, 8}))
	
	inArea = aoi:getArea(8, 1, 1, 1)
	aoi:Leave(8)
	assert(checkAOI(inArea, {3, 4, 6, 8}))
	
	local outArea, newArea  = aoi:Move(1, 2, 0, 0, 1, 1, 1)
	assert(checkAOI(outArea, {2}))
	assert(checkAOI(newArea, {6}))
	outArea, newArea  = aoi:Move(1, 2, 0, 2, 1, 1, 1)
	assert(checkAOI(outArea, {3, 4, 6}))
	assert(checkAOI(newArea, {}))
	outArea, newArea  = aoi:Move(1, 2, 0, 1, 1, 1, 1)
	assert(checkAOI(outArea, {}))
	assert(checkAOI(newArea, {3, 4, 6}))
end

